import React from "react";
import CounterMoney from "./CounterMoney";
import "./styles/Counters.css";
import CounterData from "./CounterData";

export default function Counters({ isDisabledDataCounters, money }){
    const nameCounterMoneyPerClick = "прибыль за тап";
    const nameCounterMoneyPerHour = "прибыль за час";
    if (isDisabledDataCounters){
        return (
            <div className="Counters">
                <CounterMoney />
            </div>
        );
    }else{
        return (
            <div className="Counters">
                <CounterMoney />
                <div className="CountersData">
                    <CounterData name={nameCounterMoneyPerClick} money={999} />
                    <CounterData name={nameCounterMoneyPerHour} money={999}/>
                </div>
            </div>
        );
    }
};
